import React from 'react';
import {
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  CssBaseline,
  Container,
  Typography,
} from '@mui/material';
import { Inbox as InboxIcon, Mail as MailIcon } from '@mui/icons-material';

function App() {
  return (
    <div>


      <Drawer anchor="left" open={true} sx={{ background: '#151515', width: '200px', marginLeft: '200px' }}>

      </Drawer>
      <div>
        <Container
          maxWidth="xl"
          style={{ backgroundColor: '#111115', minHeight: '100vh', marginLeft: '400px' }}
        >
          {/* Content goes here */}
        </Container>
      </div>
    </div>
  );
}

export default App;
